namespace Domain.Entities;public class SchoolInfo{    public SchoolInfo(string schoolNumber, string fullNameDirector, string countClasses, string countTeachers)    {        SchoolNumber = schoolNumber;        FullNameDirector = fullNameDirector;        CountClasses = countClasses;        CountTeachers = countTeachers;    }    public string SchoolNumber { get; set; }    public string FullNameDirector { get; set; }    public string CountClasses { get; set; }    public string CountTeachers { get; set; }}